import React from 'react';
import './Navbar.css';

export default function Navbar(){
    return (
        <div>
            <p></p><p></p><p></p>
            <p></p><p></p><p></p>
            <div className='navbar'>
            <a href="#home">Home</a>
            <a href="#news">News</a>
            <a href="#contact">Contact</a>
            </div>
        </div>
    )
}
